import React from 'react';
import TeamMember from './TeamMember';
function Team() {
    const info = [
        {id:1, img:'/images/01.jpg',  name: 'eman',position: 'oman',phone: '+91 999 121211212',email: 'eman@b-sa.com',website: 'eman.com'},
        {id:5, img:'/images/02.jfif',name: 'eman',position: 'oman',phone: '+91 999 121211212',email: 'eman@b-sa.com',website: 'eman.com'},
        {id:2, img:'/images/03.png',name: 'eman',position: 'oman',phone: '+91 999 121211212',email: 'eman@b-sa.com'},
        {id:3, img:'/images/01.jpg',name: 'eman',position: 'oman',phone: '+91 999 121211212',email: 'eman@b-sa.com',website: 'eman.com'},
        {id:4, img:'/images/02.jfif',name: 'eman',position: 'oman',phone: '+91 999 121211212',email: 'eman@b-sa.com',website: 'eman.com'},
        {id:6, img:'/images/03.png',name: 'eman',position: 'oman',phone: '+91 999 121211212',email: 'eman@b-sa.com'}
    ]
    const members = info.map(member => <TeamMember
            img={member.img}
            name={member.name}
            position={member.position}
            phone={member.phone}
            email={member.email}
            website={member.website}
        />
    )
    return (
        
		<div className="row ">
			{members}
            
		</div>
	)
}
export default Team;
